import Home from "./Components/Home/Home";
import { Redirect } from 'react-router-dom';
import React from "react";

const routes = [
    {
        path: '/',
        exact: true,
        component: () => <Redirect to="/" />
    },
    {
        path: '/',
        component: Home,
        routes: [
            {
                path: '/',
                exact: true,
                component: Home
            },
        ]
    },
];

export default routes;
